import React from 'react';
import { Container } from '@mui/material';

const LoginSucess = ({ user }) => {
  return (
    <Container>
      <h2>Seja bem-vindo, {user.name}!</h2>
      <p>Email: {user.email}</p>
    </Container>
  );
}

export default LoginSucess;
